import {Link} from 'react-router-dom';

function matchDetailComponent(props) {

  if(!props.match){return null} // important

  const team1route = `/team/${props.match.team1}`;

    return (
      <div className="matchDetailComponent">
        <h3>Match Detail Component, Date: {props.match.date}</h3>

        <p><Link to = {`/team/${props.match.team1}`} >{props.match.team1}</Link></p>

        <p>{props.match.team1} VS {props.match.team2}</p>
        <p>Winner: {props.match.winningTeam}</p>
        <p>Player Of the Match: {props.match.player_of_Match}</p>
        <p>Won By: {props.match.margin}, Method: {props.match.method}</p>
      </div>
    );
  }

  export default matchDetailComponent;
